[{"location":"#PhyNEST","page":"PhyNEST","title":"PhyNEST","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"Documentation for a Julia package PhyNEST: Phylogenetic Network Estimation using SiTe patterns.","category":"page"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"","category":"page"},{"location":"#Tutorials","page":"PhyNEST","title":"Tutorials","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"wiki tutorial","category":"page"},{"location":"#References","page":"PhyNEST","title":"References","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"Sungsik Kong, David Swofford, and Laura Kubatko (2022) Inference of Phylogenetic Networks from Sequence Data using Composite Likelihood. Preprint available online on BioRxiv at https://doi.org/10.1101/2022.11.14.516468.","category":"page"},{"location":"#Getting-help","page":"PhyNEST","title":"Getting help","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"Please use google group to report bugs or post questions and/or suggestions.","category":"page"},{"location":"#Functions","page":"PhyNEST","title":"Functions","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"    greet\n    readPhylip","category":"page"},{"location":"#PhyNEST.greet","page":"PhyNEST","title":"PhyNEST.greet","text":"greet()\n\nDisplays a simple greet message with citation information. No input argument is needed. \n\n\n\n\n\n","category":"function"},{"location":"#PhyNEST.readPhylip","page":"PhyNEST","title":"PhyNEST.readPhylip","text":"readPhylip(inputfile::AbstractString; \n            writecsv=false::Bool,\n            csvname=\"\"::AbstractString,\n            showProgress=true::Bool,\n            tdigits=3::Integer,\n            checkpoint=false::Bool)\n\nImport, read, and parse the input phylip file. File name must be specified as string. By default, progress bar is displayed, and .csv and .ckp files are NOT produced.  See optional arguments below and modify if needed.\n\nMandatory argument\n\ninputfile     Name of the phylip file as a string [mandatory]\n\nOptional arguments\n\nwritecsv       (default=false) A boolean arguement to allow writing site pattern frequencies in .csv file\ncsvname        (default=sitePatternCounts_inputfile.csv) A string that will be name of the .csv file \nshowProgress   (default=true) A boolean argument for visualizing the progress of alignment parsing\ntdigits        (default=3) Number of decimal points to record timme taken to parse the file in seconds\ncheckpoint     (default=false) A boolean argument to store the Phylip object as a .ckp file. (Warning: .ckp file can be large)\n\n\n\n\n\n","category":"function"},{"location":"#Types","page":"PhyNEST","title":"Types","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"    Phylip","category":"page"},{"location":"#PhyNEST.Phylip","page":"PhyNEST","title":"PhyNEST.Phylip","text":"Phylip\n\nSubtype of abstract INPUT type with the following attributes:\n\nfilename      Name of the input phylip alignment file\n\ntime          Time taken for parsing the input in seconds\n\nnumtaxa       Number of taxa given at the first line of the input file\n\nseqleng       Sequence length given at the first line of the input file\n\nnametaxa      Sequence names given in the input file\n\ncounttaxa     Unique integer identifier given to each individual in the order of appearance in the input file\n\nallquartet    All combinations of quartets for counttaxa\n\nindex         Just convert allquartet elements into arbitrary index numbers\n\nspcounts      Arrays of 15 site pattern frequencies for each quartet in allquartet\n\n\n\n\n\n","category":"type"},{"location":"#Index","page":"PhyNEST","title":"Index","text":"","category":"section"},{"location":"","page":"PhyNEST","title":"PhyNEST","text":"    readPhylip","category":"page"}]
